import React, {Component} from "react";
import { Link, animateScroll as scroll } from "react-scroll";
//import {Container, Navbar, Nav} from "react-bootstrap";
import {translate} from "react-switch-lang"
import logo from "./logoKancelar.png"
import "./Header.css"
//import {Container} from "react-bootstrap";

class Headers extends Component {
    scrollToTop = () => {
        scroll.scrollToTop();
    };

    render() {
    const {t} = this.props;
           return (
            <nav className="nav navbar-dark" id="navbar">
                <a className="navbar-brand" href="#">
                    <img
                        src={logo}
                        className="nav-logo"
                        alt="Logo"
                        onClick={this.scrollToTop}
                    />
                </a>
                <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNav"
                        aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
                    <span className="navbar-toggler-icon"></span>
                </button>

                <div className="collapse navbar-collapse" id="navbarNav">
                    <ul className="navbar-nav mr-auto">
                    <li className="nav-item">
                        <Link
                            activeClass="active"
                            to="section1"
                            spy={true}
                            href="#home"
                            smooth={true}
                            offset={-70}
                            duration={1000}
                        >{t('header.section1.title')}</Link>
                    </li>
                    <li className="nav-item">
                        <Link
                            activeClass="active"
                            to="section2"
                            spy={true}
                            smooth={true}
                            offset={-70}
                            duration={1000}
                        >
                            {t('header.section2.title')}
                        </Link>
                    </li>
                    <li className="nav-item">
                        <Link
                            activeClass="active"
                            to="section3"
                            spy={true}
                            smooth={true}
                            offset={-70}
                            duration={1000}
                        >
                            {t('header.section3.title')}
                        </Link>
                    </li>
                    <li className="nav-item">
                        <Link
                            activeClass="active"
                            to="section4"
                            spy={true}
                            smooth={true}
                            offset={-70}
                            duration={1000}
                        >
                            {t('header.section4.title')}
                        </Link>
                    </li>
                    <li className="nav-item">
                        <Link
                            activeClass="active"
                            to="section5"
                            spy={true}
                            smooth={true}
                            offset={-70}
                            duration={1000}
                        >
                            {t('header.section5.title')}
                        </Link>
                    </li>
                    </ul>
                </div>
            </nav>
           )
    }
}


export default translate(Headers);
